import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'

import './Topbar.css'

import { Link } from 'react-router-dom'



class Topbar extends Component {

    constructor() {
        super()
    }


    render() {

        return (
            <Navbar className="top-bar" fixed="top" expand="md">
                <Navbar.Brand as="div"><Link to="/">the<span className="bold-weight">Watch</span>men</Link></Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="ml-auto">
                        <Nav.Link as="div" className="ml-auto"><Link onClick={() => this.handleModal(true)}>Iniciar sesi√≥n</Link></Nav.Link>
                        <Nav.Link as="div" className="ml-auto"><Link to="/signup">Registro</Link></Nav.Link>
                    </Nav>
                </Navbar.Collapse>

            </Navbar>
        )
    }

}

export default Topbar
